import React from 'react';

const MainPresenter = (props) => {
    return (
        <div>
            {
                props.userManagement === 0 ?
                    <div>일반사용자</div>
                    :
                    props.userManagement === 1 ?
                        <div>관리자</div>
                        :
                        <div>비로그인</div>
            }
        </div>
    );
};

export default MainPresenter;
